import React, { Component } from "react";

import { Helmet } from "react-helmet";

class ThankYou extends Component {
  render() {
    return (
      <div className="thankyou">
        <Helmet>
          <title>Thank You | Aman Kumar</title>
        </Helmet>
        <h1>Thank You! For Being Awesome</h1>
        <h2>I'll Get Back To You As Soon As Possible :)</h2>
        <div className="thankyou__footer">
          <div>
            <h2>Miss Me Already?</h2>
            <button onClick={() => this.props.navigate("home", 0)}>
              Go Back To The Site!
            </button>
          </div>
          <div>
            <h2>Bored?</h2>
            <button onClick={this.props.playGame}>Play Breakout</button>
          </div>
        </div>
      </div>
    );
  }
}

export default ThankYou;
